import React from 'react';
import styled, {css} from 'styled-components';
import Paragraph from "./Paragraph";
const Wrapper = styled.section`
    margin: 5% 0 5% 0;
    padding: 0 5% 2% 5%
    display: flex;
    flex-direction: row;
`;
const Column = styled.div`
    padding: 0;
    width: 45%;
    height: 100%;
`;
const Title = styled.div`
    text-align: left;
    font-family: Times New Roman, serif;
    font-size: 30px;
    color: #000002;
    font-weight: lighter;
    margin: 0;
`;
var upHere = [];
function getStuff(stuff, upHere){
    for(let s in stuff){
        upHere.push(s);
    }
}
const Team = (props) => (
    <Wrapper>
        <Column>
            <Title>My Role</Title>
            {/*{props.team.members.map((r, index)=> {*/}
            {/*    return <Paragraph>{r}</Paragraph>*/}
            {/*})}*/}
            <p>{props.team.role}</p>
            {getStuff(props.team, upHere)}
            {props.team.toString()}
            {upHere}
            </Column>
        <Column>
            <Title>Team</Title>
            {/*{props.team.members.map((t, index)=>{*/}
            {/*  return  <Paragraph>{t}</Paragraph>*/}
            {/*})}*/}
             <p>{props.team.role}</p>
            {getStuff(props.team.members)}
            {upHere}
            <p>{props.team.members}</p>
        </Column>
    </Wrapper>
)

export default Team;
